import React from "react";
import "./skills.css";
import Technical from "./Technical";
const technicalSkills = {
        "Programming Languages and Frameworks" : ["Java","Groovy","ReactJS","Bootstrap"],
        "APIs and Web Services" : ["REST API","GraphQL","OAuth 2.0"],
        "Testing Frameworks and Tools" : ["Selenium","TestNG","Rest Assured","Postman"],
        "Cloud Platforms" : ["Azure"],
        "Build Tools" : ["Maven","Gradle"],
        "Database Management Systems" : ["MySQL","PostgreSQL","Oracle","RDBMS"],
        "Version Control Systems" : ["Subversion (SVN)", "Git", "Bitbucket"],
        "Continuous Integration and Deployment Tools" : ["Azure"],
        "Cloud Platforms" : ["TeamCity","Jenkins"]
   }
const methodologies = {
   "Testing Methodologies":[ "Ad-hoc testing","Functional testing","Integration testing","Sanity testing","Smoke testing","Regression testing"],
   "Types of Testing":["UI testing","API testing","Server testing","Database (DB) testing"],
   "Testing Techniques": ["Black-box","White-box","Grey-box"],
   "Tracking/Documentation Tools":["JIRA","Confluence","TestRail"]
}
export default function Skills(){
  return (
    <section className="skills section" id="skills">
      <h2 className="section__title">Skills</h2>
      <span className="section__subtitle">My technical level</span>
      <div className="skills__container container grid">
        <Technical skills = {technicalSkills}/>
      </div>

      <h2 className="section__title"></h2>
      <span className="section__subtitle">Testing methodologies</span>
      <div className="skills__container container grid">
        <Technical skills = {methodologies}/>
      </div>
    </section>
  );
};
